function getUrlParam(a){var b=new RegExp("(^|&)"+a+"=([^&]*)(&|$)");var c=window.location.search.substr(1).match(b);if(c!=null){return unescape(c[2])}return null}function randomString(b){b=b||32;var c="ABCDEFGHJKMNPQRSTWXYZabcdefhijkmnprstwxyz2345678";var a=c.length;var d="";for(i=0;i<b;i++){d+=c.charAt(Math.floor(Math.random()*a))}return d};